import styled from "styled-components";

const Container = styled.div`
    display: flex;

    align-items: center;
    justify-content: flex-start;
`;

const Oval = styled.div`
    height:200px;
    width: 210px;
    border-radius: 50%;
    background-color: #ede3df;
    position: relative;
`;

const TextContainer = styled.div`
    display:flex;
    position: absolute;
    align-items: center;
    padding-left: 40px;
`;

const Text = styled.div`
    font-family: 'Oooh Baby', cursive;
    font-size: 75px;
`;

const SubTextContainer = styled.div`
    padding-top: 100px;
    display: flex;
    position: absolute;
`;

const SubText = styled.p`
    font-size: 19px;
    padding-left: 130px;
`;

const Image = styled.img`
    height: 80px;
    z-index: -1;
`;
                                                
const Logo = () => {
    return(
    <Container>
        <Oval/>
        <TextContainer>            
            <Text>CULT</Text>
            <Image src={require("../images/letterR.png")}/>
        </TextContainer>
        <SubTextContainer>
            <SubText>M A G A Z I N E</SubText>
        </SubTextContainer>
        {/* <TextContainer>            
            <Text>CULT</Text>
            <Image src={require("../images/letterR.png")}/>
        </TextContainer>
        <SubTextContainer>
            <SubText>M A G A Z I N E</SubText>
        </SubTextContainer> */}
    </Container>
    );   
}

export default Logo;
